import React, {useState} from 'react';
import axios from 'axios'
function Messages(props) {

    const [IgMessages, setIgMessages] = useState([])
    const [FbMessages, setFbMessages] = useState([])

    let getFbMessages = () => {
        axios.get('http://localhost:5000/messages/fb')
        .then(response => {
            console.log(response.data.data)
            setFbMessages(response.data.data)
        })
    }

    let getIgMessages = () => {
        axios.get('http://localhost:5000/messages/ig')
        .then(response => {
            console.log(response.data.data)
            setIgMessages(response.data.data)
        })
    }

    return (
        <div>
            <button onClick={getFbMessages}>Get Fb Messages</button>
            <button onClick={getIgMessages}>Get Ig Messages</button>
            <div className='message_header'>{FbMessages[0].snippet}</div>
        </div>
    );
}

export default Messages;
